8\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u0438 \u0431\u044b\u043b\u0430 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BF%D0%BB%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\">\u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u0434\u0430\u0442\u0430 \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u0441\u043f\u043e\u0440\u0442\u0438\u0432\u043d\u043e\u0439 \u0434\u0438\u0441\u0446\u0438\u043f\u043b\u0438\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%B1%D0%BE\" title=\"\u0421\u0430\u043c\u0431\u043e\">\u0441\u0430\u043c\u0431\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a><ul><li>\u041e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043e\u0431 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0438 \u0442\u044f\u0436\u0451\u043b\u044b\u0445 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D1%86%D0%B8%D0%B9\" title=\"\u0410\u043c\u0435\u0440\u0438\u0446\u0438\u0439\">\u0430\u043c\u0435\u0440\u0438\u0446\u0438\u044f<\/a> (\u0430\u0442\u043e\u043c\u043d\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 95) \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%8E%D1%80%D0%B8%D0%B9\" title=\"\u041a\u044e\u0440\u0438\u0439\">\u043a\u044e\u0440\u0438\u044f<\/a> (96).<\/li><li>\u041e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E\" title=\"\u042e\u041d\u0415\u0421\u041a\u041e\">\u042e\u041d\u0415\u0421\u041a\u041e<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B0\" title=\"\u0412\u0430\u0440\u0448\u0430\u0432\u0430\">\u0412\u0430\u0440\u0448\u0430\u0432\u0435<\/a> II \u0412\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0433\u043e \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0430 \u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0438\u043a\u043e\u0432 \u043c\u0438\u0440\u0430. \u0421\u043e\u0437\u0434\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D0%B2%D0%B5%D1%82_%D0%BC%D0%B8%D1%80%D0%B0\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u044b\u0439 \u0441\u043e\u0432\u0435\u0442 \u043c\u0438\u0440\u0430\">\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0433\u043e \u0421\u043e\u0432\u0435\u0442\u0430 \u041c\u0438\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%90%D0%BD-10_%D0%B2%D0%BE_%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2%D0%B5_(1959)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0410\u043d-10 \u0432\u043e \u041b\u044c\u0432\u043e\u0432\u0435 (1959)\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0410\u043d-10 \u0432\u043e \u041b\u044c\u0432\u043e\u0432\u0435<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 40 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D0%B5%D0%BD%D1%83%D0%BC_%D0%A6%D0%9A_%D0%9A%D0%9F%D0%A1%D0%A1\" title=\"\u041f\u043b\u0435\u043d\u0443\u043c \u0426\u041a \u041a\u041f\u0421\u0421\">\u041f\u043b\u0435\u043d\u0443\u043c \u0426\u041a \u041a\u041f\u0421\u0421<\/a> \u043f\u043e\u0441\u043b\u0435 \u0441\u043c\u0435\u0449\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D1%83%D1%89%D1%91%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%B8%D1%82%D0%B0_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0425\u0440\u0443\u0449\u0451\u0432, \u041d\u0438\u043a\u0438\u0442\u0430 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041d\u0438\u043a\u0438\u0442\u044b \u0425\u0440\u0443\u0449\u0451\u0432\u0430<\/a>. \u0420\u0435\u0448\u0435\u043d\u0438\u0435 \u043e\u0431 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0438 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u044b\u0445 \u0438 \u0441\u0435\u043b\u044c\u0441\u043a\u0438\u0445 \u043f\u0430\u0440\u0442\u0438\u0439\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439 \u0438 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u043e\u0440\u0433\u0430\u043d\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a>&#160;\u2014 \u0412 \u0421\u0421\u0421\u0420 \u0437\u0430\u043f\u0443\u0449\u0435\u043d\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0-3\" title=\"\u0412\u0435\u043d\u0435\u0440\u0430-3\">\u0412\u0435\u043d\u0435\u0440\u0430-3<\/a>\u00bb, \u0431\u0435\u0441\u043f\u0438\u043b\u043e\u0442\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BF%D0%BF%D0%B0%D1%80%D0%B0%D1%82\" title=\"\u041a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442\">\u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0435\u0440\u0432\u044b\u043c \u0434\u043e\u0441\u0442\u0438\u0433 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0\" title=\"\u0412\u0435\u043d\u0435\u0440\u0430\">\u0412\u0435\u043d\u0435\u0440\u044b<\/a> (\u0432\u0440\u0435\u0437\u0430\u043b\u0441\u044f \u0432 \u043d\u0435\u0451). \u0421\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u0437\u0435\u043c\u043d\u044b\u043c \u0430\u043f\u043f\u0430\u0440\u0430\u0442\u043e\u043c, \u0434\u043e\u0441\u0442\u0438\u0433\u0448\u0438\u043c \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u044c \u0434\u0440\u0443\u0433\u043e\u0439 \u043f\u043b\u0430\u043d\u0435\u0442\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u041d\u0430\u0431\u043b\u044e\u0434\u0430\u0435\u0442\u0441\u044f \u0441\u0430\u043c\u044b\u0439 \u043e\u0431\u0438\u043b\u044c\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D0%B5%D0%BE%D1%80%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D1%82%D0%BE%D0%BA\" title=\"\u041c\u0435\u0442\u0435\u043e\u0440\u043d\u044b\u0439 \u043f\u043e\u0442\u043e\u043a\">\u0437\u0432\u0435\u0437\u0434\u043e\u043f\u0430\u0434<\/a>: \u0434\u043e 2300 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D0%B5%D0%BE%D1%80\" title=\"\u041c\u0435\u0442\u0435\u043e\u0440\">\u043c\u0435\u0442\u0435\u043e\u0440\u043e\u0432<\/a> \u0432 \u043c\u0438\u043d\u0443\u0442\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-18_%D0%B2_%D0%A1%D0%B2%D0%B5%D1%80%D0%B4%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B5_(1967)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-18 \u0432 \u0421\u0432\u0435\u0440\u0434\u043b\u043e\u0432\u0441\u043a\u0435 (1967)\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-18 \u0432 \u0421\u0432\u0435\u0440\u0434\u043b\u043e\u0432\u0441\u043a\u0435<\/a>, 107 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445&#160;\u2014 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u0421\u0421\u0421\u0420 \u043d\u0430 \u0442\u043e \u0432\u0440\u0435\u043c\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974\" class=\"mw-redirect\" title=\"1974\">1974<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D0%B6%D0%B5%D0%BD%D0%B8%D1%86%D1%8B%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%98%D1%81%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u043e\u043b\u0436\u0435\u043d\u0438\u0446\u044b\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0418\u0441\u0430\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u043e\u043b\u0436\u0435\u043d\u0438\u0446\u044b\u043d<\/a> \u043f\u0440\u043e\u0432\u0451\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D1%8E%D1%80%D0%B8%D1%85\" title=\"\u0426\u044e\u0440\u0438\u0445\">\u0426\u044e\u0440\u0438\u0445\u0435<\/a> \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u0443\u044e \u043f\u0440\u0435\u0441\u0441-\u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044e \u00ab\u041e \u0431\u0443\u0434\u0443\u0449\u0435\u043c \u0420\u043e\u0441\u0441\u0438\u0438\u00bb. \u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044c \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b \u00ab\u041f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0443 \u201e\u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438\u201c\u00bb, \u0438\u0437\u043b\u043e\u0436\u0435\u043d\u043d\u0443\u044e \u0432 \u044d\u0441\u0441\u0435-\u043c\u0430\u043d\u0438\u0444\u0435\u0441\u0442\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B8%D1%82%D1%8C_%D0%BD%D0%B5_%D0%BF%D0%BE_%D0%BB%D0%B6%D0%B8\" class=\"mw-redirect\" title=\"\u0416\u0438\u0442\u044c \u043d\u0435 \u043f\u043e \u043b\u0436\u0438\">\u0416\u0438\u0442\u044c \u043d\u0435 \u043f\u043e \u043b\u0436\u0438<\/a>\u00bb<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%AF%D0%BA-40_%D0%BF%D0%BE%D0%B4_%D0%92%D0%BE%D0%BB%D0%BE%D0%B3%D0%B4%D0%BE%D0%B9\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u042f\u043a-40 \u043f\u043e\u0434 \u0412\u043e\u043b\u043e\u0433\u0434\u043e\u0439\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u042f\u043a-40 \u043f\u043e\u0434 \u0412\u043e\u043b\u043e\u0433\u0434\u043e\u0439<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 3 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>:<ul><li>\u0412\u044b\u0441\u0442\u0443\u043f\u0430\u044f \u043d\u0430 \u041f\u043b\u0435\u043d\u0443\u043c\u0435 \u0426\u041a, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D0%B6%D0%BD%D0%B5%D0%B2,_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u0411\u0440\u0435\u0436\u043d\u0435\u0432, \u041b\u0435\u043e\u043d\u0438\u0434 \u0418\u043b\u044c\u0438\u0447\">\u041b\u0435\u043e\u043d\u0438\u0434 \u0411\u0440\u0435\u0436\u043d\u0435\u0432<\/a> \u0437\u0430\u0442\u0440\u043e\u043d\u0443\u043b \u0432\u043e\u043f\u0440\u043e\u0441 \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u0440\u043e\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u044b. \u041e\u043d \u0441\u043a\u0430\u0437\u0430\u043b, \u0447\u0442\u043e \u00ab\u043d\u0435\u0442 \u0434\u0435\u043b\u0430 \u0431\u043e\u043b\u0435\u0435 \u0432\u0430\u0436\u043d\u043e\u0433\u043e, \u0431\u043e\u043b\u0435\u0435 \u0431\u043b\u0430\u